Step 1: Create Lending Desk Use the initializeNewLendingDesk function to establish a new lending desk within the Magnify Cash protocol. This enables you to define your lending parameters and get ready to offer loans. JavaScript/TypeScript (using ethers.js) - Example: const initializeNewLendingDesk = async () => { // Connect to Ethereum network using ethers.js const provider = new ethers.providers.JsonRpcProvider('YOUR_RPC_URL'); const signer = provider.getSigner(); // Instantiate MagnifyCashV1 contract const contract = new ethers.Contract('MagnifyCashV1_CONTRACT_ADDRESS', MagnifyCashV1_ABI, signer); // Prepare the inputs (erc20ToLoan, initialFundingAmount, loanConfigs) const erc20ToLoan = "0x..." const initialFundingAmount = 100 const loanConfigs = [{ nftCollection: erc721.address, minAmount: ethers.utils.parseUnits("10", 18), maxAmount: ethers.utils.parseUnits("100", 18), minDuration: BigNumber.from(24), maxDuration: BigNumber.from(240), minInterest: BigNumber.from(200), maxInterest: BigNumber.from(1500), }]; // Call the initializeNewLendingDesk function const tx = await contract.initializeNewLendingDesk(erc20ToLoan, initialFundingAmount, loanConfigs); await tx.wait(); console.log('Lending desk created successfully!');
}; Python (using web3.py) - Example: from web3 import Web3 w3 = Web3(Web3.HTTPProvider('YOUR_RPC_URL')) # Get contract
contract = w3.eth.contract(address='MagnifyCashV1_CONTRACT_ADDRESS', abi=MagnifyCashV1_ABI) # Prepare the inputs (erc20ToLoan, initialFundingAmount, loanConfigs)
erc20ToLoan = "0x..."
initialFundingAmount = 100
loanConfigs = [{ nftCollection: erc721.address, minAmount: 1, maxAmount: 100, minDuration: 30, maxDuration: 120, minInterest: 100, maxInterest: 1000,
}]; # Call the initializeNewLendingDesk function
tx_hash = contract.functions.initializeNewLendingDesk( erc20ToLoan, initialFundingAmount, loanConfigs
).transact()
tx_receipt = w3.eth.waitForTransactionReceipt(tx_hash) print('Lending desk created successfully!')

